@Hanna64556159 @DanutaWioletta Po wpadkach KN ze znajomości historii, popełniłam taki wpis ;
Historyk, który zaorał historię.
Po spotkaniu Nawrocki-Mentzen,
Nawrocki, który uczynił Mentzena, mężem stanu, paradoks.
Facet, którego kojarzyłam z hulajnogą na tle kandydata obywatelskiego, urasta do takiej rangi.

@Nawrocki25 Karol zdobywa coraz większe poparcie normalnych ludzi, którzy zaczynają sobie uświadamiać, kto nimi rządzi, gardzi i poniewiera. Tego się już nie zatrzyma.

😃 Panie Nawrocki, wygra Pan te wybory!
#Nawrocki2025Prezydentem

@R_A_Ziemkiewicz No tak,nikt się nie spodziewał.
Kapusie,zdrajcy,zaprzancy.
Nie uda im się.Czas dokończyć 1992 rok,jak sp.Jan Olszewski walczył o Polskę.Bolek,rudy,kilku innych ,uratowali się wtedy.Jak nie teraz,to będzie prze.ebane na długie lata.
